import React from 'react';
import Navigationbar from './Navigationbar.js'
import Projects from './projects.js'
import Translateme from './translateme.js'
import Rickandmorty from './rickandmorty.js'
import Tonester from './tonester.js'


import './App.css';

class App extends React.Component {
    constructor(){
      super()
      this.state = {
        pageState: "home"
      }
    }
  handleTranslateme=()=>{
    this.setState({
      pageState: "translateme"
    })
  }

  handleRickAndMorty=()=>{
    this.setState({
      pageState: "rickandmorty"
    })
  }

  handleTonester=()=>{
    this.setState({
      pageState: "tonester"
    })
  }


  render(){
  return (
    <div className="App">
     <Navigationbar handleSection1={this.handleSectionOne}/>
    {this.handlePage()}
    </div>
  );
  }
}

export default App;
